import React from 'react';
import './Navbar.css'
import logo from '../../Assets/logo.png';

const Navbar = () => {
  return (
    <nav>
        <div className='s1'>
            <img src={logo} alt='logo' className='logo' />
        </div>
        <div className='s2'></div>
    </nav>
  );
}

export default Navbar;
